import React, { useState } from "react";
import "./Register.css";
function Register() {
  const [name, setName] = useState();
  const [email, setEmail] = useState();
  const [mobile, setMobile] = useState();
  const [pass, setPass] = useState();
  const HandleSubmit = () => {
    var usersData = JSON.parse(localStorage.getItem("usersData" || "[]"));

    var newUser = {
      name: name,
      email: email,
      mobile: mobile,
      pass: pass,
    };
    usersData.push(JSON.stringify(newUser));

    // localStorage.setItem("Name", name);
    // localStorage.setItem("Password", pass);
    // localStorage.setItem("email", email);
    // localStorage.setItem("Mobile", mobile);
  };

  return (
    <div className="Register">
      <div claPasswordssName="Register_Inner">
        <h1>REGESTER</h1>
        <div className="Register_Inner_Name">
          <h5>FULL NAME</h5>
          <input
            type="text"
            placeholder="Type Your Name"
            onChange={(e) => setName(e.target.value)}
          />
        </div>
        <div className="Register_Inner_Email">
          <h5>EMAIL</h5>
          <input
            type="text"
            placeholder="Type Your Email"
            onChange={(e) => setEmail(e.target.value)}
          />
        </div>
        <div className="Register_Inner_Mobile">
          <h5>MOBILE NUMBER</h5>
          <input
            type="number"
            placeholder="Type Your MOBILE NUMBER"
            onChange={(e) => {
              setMobile(e.target.value);
            }}
          />
        </div>
        <div className="Register_Inner_Password">
          <h5>PASSWORD</h5>
          <input
            type="password"
            placeholder="Type Unique Password"
            onChange={(e) => setPass(e.target.value)}
          />
        </div>
        <div className="Register_Inner_Footer">
          <button type="submit" onClick={HandleSubmit}>
            REGESTER
          </button>
          <h4>
            Already have an account?<span>Login</span>
          </h4>
        </div>
      </div>
    </div>
  );
}

export default Register;
